// https://leetcode-cn.com/problems/minimum-window-substring/
#include <cstdio>
#include <string>
#include <vector>
#include <unordered_set>
#include <unordered_map>
using namespace std;

static bool debug = false;

class Solution {
public:
	string minWindow(string s, string t) {
		if (debug) { printf("================\n'%s', '%s'\n", (s.size() > 50 ? (s.substr(0, 50) + "...").c_str() : s.c_str()), (t.size() > 50 ? (t.substr(0, 50) + "...").c_str() : t.c_str())); }
		if (t.empty()) return "";
		int counter[256] = { 0 };
		unordered_map<char, int> target;
		for (int i = 0; i < t.size(); ++i) {
			++target[t[i]];
		}
		int start = 0, end = 0;
		while (end < t.size()) {
			++counter[charToIndex(s[end++])];
		}
		int min_size = 0, a = -1, b = -1;
		for (;;) {
			while (end <= s.size() && !valid(target, counter)) {
				++counter[charToIndex(s[end++])];
				if (debug) { printf("[A] start = %d, end = %d, valid = %d", start, end, valid(target, counter)); for (auto e : target) { printf(" [%c,%d/%d]", e.first, counter[charToIndex(e.first)], e.second); }; printf("\n"); }
			}
			if (end > s.size()) break;
			while (start + t.size() <= end && valid(target, counter)) {
				int size = end - start;
				if (min_size == 0 || size < min_size) {
					if (debug) { printf("Set: {%d, %d, %d}\n", size, start, end); }
					min_size = size;
					a = start;
					b = end;
				}
				--counter[charToIndex(s[start++])];
				if (debug) { printf("[B] start = %d, end = %d, valid = %d", start, end, valid(target, counter)); for (auto e : target) { printf(" [%c,%d/%d]", e.first, counter[charToIndex(e.first)], e.second); }; printf("\n"); }
			}
		}
		if (min_size == 0) return "";
		if (debug) { printf("Results: {%d, %d, %d}\n", min_size, a, b); }
		return s.substr(a, b - a);
	}
private:
	inline static int charToIndex(char c) {
		return static_cast<int>(static_cast<unsigned char>(c));
	}
	inline static bool valid(const unordered_map<char, int>& target, int counter[256]) {
		for (auto e : target) {
			if (counter[charToIndex(e.first)] < e.second) return false;
		}
		return true;
	}
};

extern const char* longString;
extern const char* longQuery;

int main()
{
	Solution s;
	printf("%s\n", s.minWindow("ADOBECODEBANC", "ABC").c_str()); // answer: "BANC"
	printf("%s\n", s.minWindow("a", "aa").c_str()); // answer: "a"
	printf("%s\n", s.minWindow("aba", "aa").c_str()); // answer: "aba"
	printf("%s\n", s.minWindow("abaa", "aa").c_str()); // answer: "aa"
	printf("%s\n", s.minWindow("aaabaabab", "aab").c_str()); // answer: "aab"
	printf("%s\n", s.minWindow("cabefgecdaecf", "cae").c_str()); // answer: "ace"
	printf("%s\n", s.minWindow("b..a...cb....a.b", "abc").c_str()); // answer: "a...cb"
	printf("%s\n", s.minWindow("a", "a").c_str()); // answer: "a"
	printf("%s\n", s.minWindow("a", "b").c_str()); // answer: ""
	printf("%s\n", s.minWindow("a", "ab").c_str()); // answer: ""
	printf("%s\n", s.minWindow("ask_not_what_your_country_can_do_for_you_ask_what_you_can_do_for_your_country", "ask_country").c_str()); // answer: "sk_not_what_your_countr"
	printf("%s\n", s.minWindow("cabwefgewcwaefgcf", "cae").c_str()); // answer: "cwae"
	printf("%s\n", s.minWindow("", "").c_str()); // answer: ""
	printf("%s\n", s.minWindow("abcabdebac", "cda").c_str()); // answer: "cabd"
	printf("%s\n", s.minWindow("", "fjknwevk").c_str()); // answer: ""
	printf("%s\n", s.minWindow(longString, longQuery).c_str());
	return 0;
}

const char* longString = "";
const char* longQuery = "";
